import React from 'react';
import styled from 'styled-components';

const Todo = styled.div`
  font-size: 32px;
  border-top: 2px solid #efefef;
`;

const TodoItem = ({ data }) => {
  return <Todo>Todo!!{data.data}</Todo>;
};

export default TodoItem;
